  \"2013-03-14T19:33:05.926352\",\n\t\"name\": \"vegetation-n-sierra-foothills-ds566\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The California Department of Fish and Game
  (CDFG) worked collaboratively with the California Native Plant Society (CNPS) and
  Aerial Information Systems (AIS) to produce a fine-scale vegetation map of the northern
  Sierra Nevada Foothills region, here defined by the two northern subsections of
  the USDA's Sierra Nevada Foothills Section (Miles and Goudey 1997). This includes
  2.6 million acres of land, with approximately 15% under public ownership and 85%
  under private ownership. Vegetation sampling by means of the CNPS Relevu0102u0160
  and Rapid Assessment Protocols was used to obtain a total of 710 Relevu0102u0160s
  and 1691 Rapid Assessments, which were used to develop a quantitative classification
  based on cluster and indicator species analyses. The resulting classification describes
  vegetation types according to the National Vegetation Classification System; and
  was used as a basis for creating a map classification generally at the alliance
  level, where natural vegetation stands were discernable to that level using 1-meter
  aerial imagery acquired as part of the National Agricultural Imagery Program (NAIP)
  in 2005 and 2009. The vegetation map includes 67 map units, of which 54 are natural
  vegetation map units at the floristic alliance level or higher (group) level and
  13 are non-vegetation land use mapping units.\",\n\t\"license_title\": null,\n\t\"extras\":
